import AppHeader from "../appHeader/AppHeader";

const App = () => {
    return (
        <Router>
            <div className="app">
                <AppHeader/>
                <main>
                    <Switch>
                        <Route exact path="/">

                        </Route>
                        <Route exact path="/comics"> 

                        </Route>
                    </Switch>
                </main>
            </div>
        </Router>
    )
}
App.propTypes={
    onCharSelected: PropTypes.number
}
export default App;
